import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class Navbar extends Component{
    render(){
        return(
                <div>
                 	<header classname="header">
		            <h1 className="logo">covid-counter</h1>
                    <ul className="main-nav">
                        <li>Home</li>
                        <li>About</li>
                        <li>Portfolio</li>
                        <li>Contact</li>
                    </ul>
	                </header> 

                </div>

        )
    }
}

ReactDOM.render(
    <Navbar />,

    document.getElementById('root')
  );
